  // const theme = useTheme();

  // const { basket } = useAppSelector((state) => state.basket);
  // const { user } = useAppSelector((state) => state.account);
  // const itemCount = basket?.reduce((sum, item) => sum + item.quantity, 0);
  // const isMobile = useMediaQuery("(max-width:600px)");
  const [headerIsOpen, setHeaderIsOpen] = useState(false);
  const [activeMenu, setactiveMenu] = useState(0);

  const HeaderStateHandler = useCallback(() => {
    setHeaderIsOpen(true);
    // document.body.classList.toggle("has-overlay", this.state.overlay)
    document.body.classList.add("has-overlay");
  }, []);
  const HeaderStatCloseHandler = useCallback(() => {
    setHeaderIsOpen(false);
    document.body.classList.remove("has-overlay");
  }, []);

  const ActiveMenuHandler = useCallback(
    (e: React.PointerEvent<HTMLLIElement>) => {
      setactiveMenu(e.currentTarget.value);
    },
    []
  );

  const MenuLeaveHandler = useCallback(
    (e: React.PointerEvent<HTMLLIElement>) => {
      setactiveMenu(0);
    },
    []
  );

  const cartOpenHandler = useCallback(() => {
    var x = document.getElementsByClassName("cart");
    var i;
    for (i = 0; i < x.length; i++) {
      x[i].className += " is-active"; // WITH space added
    }
    document.body.classList.add("has-overlay");
    document.body.classList.add("has-cart-overlay");
  }, []);

  const closeCartBtnHandler = useCallback(() => {
    var x = document.getElementsByClassName("cart");
    var i;
    for (i = 0; i < x.length; i++) {
      x[i].classList.remove("is-active"); // WITH space added
    }
    document.body.classList.remove("has-overlay");
    document.body.classList.remove("has-cart-overlay");
  }, []);

